import React from "react";
import TodayNoti from "./HomeComponents/TodayNoti";
import StatTable from "./HomeComponents/StatTable";
import TasksReview from "./HomeComponents/TasksReview";

const Home = () => {
  return (
    <div>
      {/* Container */}
      <div>
        {/* Layout */}
        <section>
          <TodayNoti />
          <StatTable />
        </section>
        <div></div>
        <TasksReview />
      </div>
    </div>
  );
};

export default Home;
